import React from "react";
import Video from "./Video";
import "./Videos.css";

const videos = [
  {
    url: "videos/first.mp4",
    channel: "bulat",
    description: "Первое видео",
    likes: 2100000,
    dislikes: 12000,
    comments: 8000,
  },
  {
    url: "videos/second.mp4",
    channel: "user2",
    description: "Второе видео",
    likes: 34000,
    dislikes: 2100,
    comments: 120,
  },
  {
    url: "videos/third.mp4",
    channel: "user3",
    description: "Третье видео",
    likes: 7000,
    dislikes: 300,
    comments: 50,
  },
  {
    url: "videos/fourth.mp4",
    channel: "user4",
    description: "Четвёртое видео",
    likes: 120000,
    dislikes: 4000,
    comments: 900,
  },
  {
    url: "videos/fifth.mp4",
    channel: "user5",
    description: "Пятое видео",
    likes: 19000,
    dislikes: 500,
    comments: 200,
  },
  {
    url: "videos/sixth.mp4",
    channel: "user6",
    description: "Шестое видео",
    likes: 41000,
    dislikes: 2100,
    comments: 1300,
  },
];

function Videos() {
  return (
    <div className="videos">
      {videos.map((video, index) => (
        <Video
          key={index}
          url={video.url}
          channel={video.channel}
          description={video.description}
          likes={video.likes}
          dislikes={video.dislikes}
          comments={video.comments}
        />
      ))}
    </div>
  );
}

export default Videos;
